import React from 'react'
import '../css_styles/Navbars.css';

const Navbars = () => {
    return (
        <div className="navbar">
            <div className="navbar__list">
            <h4>Technology</h4>
            </div>
            <div className="navbar__list">
            <input placeholder='search'/>
            </div>

            <h4>My Logo</h4>
        </div>
    )

}


export default Navbars
